import React from 'react';

class Destination extends React.Component {
    render() {
      return (
      <div>
        <h1>Pick Your Destination</h1>;
        <ul>
          <li>MOON</li>
          <li>MARS</li>
          <li>EUROPA</li>
          <li>TITAN</li>
        </ul>
        <h1>{this.state.title}</h1>
        <p>{this.state.description}</p>
        <h1>AVG. DISTANCE</h1>
        <h1>EST. TRAVEL TIME</h1>
      </div>
        )
    }
  }

export default Destination;
